import React, { useState } from "react";
import DataTable from "react-data-table-component";
import tableCustomStyles from "../commonStyles/tableCustomStyle";

function Table({ columnsHeading, data }) {
  return (
    <div className="w-[95%]">
      <DataTable
        key={data._id}
        columns={columnsHeading}
        data={data}
        // customStyles={tableCustomStyles}
        highlightOnHover
        pagination
      ></DataTable>
    </div>
  );
}

export default Table;
